import React, { useState } from 'react';
import LoginForm from './components/LoginForm';
import RegisterForm from './components/RegisterForm';
import ComplaintForm from './components/ComplaintForm';
import OpenComplaints from './components/OpenComplaints';
import SolvedComplaints from './components/SolvedComplaints';
import ViewComplaint from './components/ViewComplaint';

const App = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [currentUser, setCurrentUser] = useState(null);

  // ...

  const handleLogin = (user) => {
    setCurrentUser(user);
  };

  const handleLogout = () => {
    setCurrentUser(null);
  };

  return (
    <div className="app-container">
      {!currentUser ? (
        <div>
          {isLogin ? <LoginForm handleLogin={handleLogin} /> : <RegisterForm />}
          <button onClick={() => setIsLogin(!isLogin)}>
            {isLogin ? 'Kayıt Ol' : 'Giriş Yap'}
          </button>
        </div>
      ) : (
        <div>
          {/* Navbar */}
          <nav>
            <ul>
              <li>Arıza Kaydı Oluştur</li>
              <li>Açık Arızalar</li>
              <li>Çözümlenmiş Arızalar</li>
              <li>Kullanıcı İşlemleri</li>
              <li onClick={handleLogout}>Çıkış Yap</li>
            </ul>
          </nav>

          {/* Content */}
          {/* Burada diğer component'ları kullanarak sayfa içeriğini gösterin */}
          {/* Örnek: <ComplaintForm />, <OpenComplaints />, <SolvedComplaints />, <ViewComplaint /> */}
        </div>
      )}
    </div>
  );
};

export default App;
